import React from "react";
import Email from '../assets/svg/icon-email.svg'
import map from '../assets/svg/icon-map.svg'
import Phone from '../assets/svg/icon-phone.svg'

export default class Footer extends React.Component {
  render() {
    return (
      <div style={{backgroundColor: '#259eb9'}} className="margin-footer">
        <div className="row">
          <div className="margin-row-footer"><img src={map} alt="email" style={{width: 28}}/></div>
          <div className="margin-row-footer " style={{width: '10vw'}}><img src={Email} alt="email" style={{width: 28}}/></div>
          <div className="margin-row-footer "><img src={Phone} alt="email" style={{width: 28}}/></div>
        </div>
      </div>
    );
  }
}
